(119, 'GC1', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/1.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Xbox Series X Controller</strong></h4>\r\n<ul>\r\n<li>The black model, which is what you&rsquo;ll get with the launch-day version of the Xbox Series X, looks very, very similar to the Bluetooth-enabled model that came out with the Xbox One S and X:</li>\r\n<li>its black matte plastic shell, multi-colored, face buttons, and analog sticks all look and feel identical to their predecessors.<br />If you know your way around an Xbox One controller you&rsquo;ll have no problem finding the pairing button on top, the plate in the back that covers two AA batteries, and two ports on the bottom<br />Tthe proprietary port for connecting the Xbox chatpad, and a 3.5mm audio jack for wired headsets.</li>\r\n</ul>'),
(120, 'GC2', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/2.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Product details of Xbox 360 Controller,USB Wired Controller Gamepad for Microsoft Xbox 360,PC Windowns,XP,Vista,Win7 - Black</strong></h4>\r\n<ul>\r\n<li>Product Type: Wired Controller</li>\r\n<li>Color: Black</li>\r\n<li>Model: Xbox 360</li>\r\n<li>Compact ergonomics for comfortable play</li>\r\n<li>Integrated headset port for Xbox LIVE</li>\r\n<li>Adjustable vibration feedback for a personalized gaming experience</li>\r\n<li>High quality product</li>\r\n<li>Easy to use</li>\r\n</ul>'),
(121, 'GC3', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/3.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Product details of Hitman 2 XBOX ONE Game</strong></h4>\r\n<ul>\r\n<li>Improvise bigger, better, deadlier hits than ever<br />Track your targets across 6 new exotic locations.<br />To eliminate the elusive shadow client, you must first Unravel his past.<br />Access franchise first like the all-new co-op Sniper assassin mode</li>\r\n</ul>'),
(122, 'GC4', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/4.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Product details of Gears Tactics - Xbox Series X &amp; Xbox One</strong></h4>\r\n<ul>\r\n<li>Immersive and character-driven story: play as the defiant soldier gabe diaz, rescuing and building your troops in a journey of leadership, survival, and sacrifice.<br />Customizable squad and equipment: prepare your troops to face tough enemies, upgrading their skills and outfitting them with loot collected in challenging missions.<br />Aggressive gameplay: command your squad in fast-paced, turn-based battles, advancing and surviving intense and visceral encounters with the unstoppable, swarming enemy.<br />Massive boss battles: defeat towering deadly bosses that defy your strategies and completely change the scale of the battle.</li>\r\n</ul>'),
(123, 'GC5', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/5.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/5.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/5.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/6.%20Gaming%20Consoles/5.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Product details of GTA 5 for Xbox one Game</strong></h4>\r\n<ul>\r\n<li>Grand Theft Auto V is a 2013 action-adventure game developed by Rockstar North and published by Rockstar Games.<br />It is the first main entry in the Grand Theft Auto series since 2008\'s Grand Theft Auto IV.</li>\r\n<li>Set within the fictional state of San Andreas, based on Southern California, the single-player story follows three protagonists&mdash;retired bank robber Michael De Santa, street gangster</li>\r\n<li>Franklin Clinton, and drug dealer and arms smuggler Trevor Philips&mdash;and their efforts to commit heists while under pressure from a corrupt government agency and powerful criminals.</li>\r\n<li>The open world design lets players freely roam San Andreas\' open countryside and the fictional city of Los Santos, based on Los Angeles.</li>\r\n</ul>'),
(124, 'C1', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/7.%20Cameras/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/7.%20Cameras/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/7.%20Cameras/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/1.%20Electronic%20Devices/7.%20Cameras/1.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Black', 'NO', '<h4><strong>Product details of Canon EOS M50 Mirrorless Digital Camera with 15-45mm Lens - Black</strong></h4>\r\n<ul>\r\n<li>24.1MP APS-C CMOS Sensor</li>\r\n<li>DIGIC 8 Image Processor</li>\r\n<li>2.36m-Dot OLED Electronic Viewfinder</li>\r\n<li>3.0\" 1.04m-Dot Vari-Angle Touchscreen</li>\r\n</ul>'),
