camera only): approximately 449 grams<br />Easy to take with you thanks to the compact design<br />High-quality photos and videos with excellent contrast and perfect sharpness<br />Smooth performance while recording videos<br />The Image Stabilizer of the lens prevents camera shake for smooth and stable images<br />The optics of the lens ensure sharp, detailed video images<br />The compact design feels great in combination with the body of EOS SLR cameras</li>\r\n</ul>'),
