(171, 'Storage1', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/7.%20Storage/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/7.%20Storage/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/7.%20Storage/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/7.%20Storage/1.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Product details of Transcend 2TB StoreJet 25H3 Portable Hard Drives- Purple</strong></h4>\r\n<ul>\r\n<li>The StoreJet 25H3 external hard drive is equipped with the USB 3.1 Gen 1 interface with the support of UASP (USB Attached SCSI Protocol), providing lightning-fast transfer rates of up to 5Gbps.</li>\r\n<li>The StoreJet 25H3 features a three-stage shock protection system that meets US military drop-test standards to fully protect data stored on the drive.</li>\r\n<li>Transcend Elite is advanced data management software that keeps important files organized, protected, and up-to-date.</li>\r\n</ul>'),
