(197, 'NC2', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/2.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Product details of TP-Link AC1750 Wireless MU-MIMO Gigabit Ceiling Mount Access Point (EAP245)</strong></h4>\r\n<ul>\r\n<li>Simultaneous 450Mbps on 2.4GHz and 1300Mbps on 5GHz totals 1750Mbps Wi-Fi speeds</li>\r\n<li>Supports Seamless Roaming so even video streams and voice calls are unaffected as users move between locations</li>\r\n<li>Free cloud centralized management and Omada app for ultra convenience and easy management</li>\r\n<li>Support Power over Ethernet(802.3at/802.3af) for convenient and affordable installation</li>\r\n<li>Secure guest network along with multiple authentication options (SMS/Facebook Wi-Fi/ Voucher, etc.) and abundant wireless security technologies.</li>\r\n<li>Band Steering Automatically moves dual band devices onto the wider 5GHz band for faster connections</li>\r\n<li>Load balance ensures large numbers of users have smooth network experiences in high density business networks</li>\r\n<li>Supports management VLANfor an enhanced network management</li>\r\n</ul>'),
(198, 'NC3', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/3.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<p>Product details of LTE 4G (Dongle) 150Mbps Wireless WiFI 4G Portable Router</p>\r\n<ul>\r\n<li>Enjoy 4G features on your all your Wi-Fi capable devices<br />True 4G speed &ndash; download speed up to 150 Mbps and upload speed up to 50 Mbps. Note: Device require power source(No battery), i.e plug and play</li>\r\n<li>Recommended to connect up to 10 Wi-Fi enabled devices (smartphone, laptops, tablets and even smart TVs)<br />Make video and HD voice calls, audio &amp; video conference, send</li>\r\n<li>SMS with jiocall voice app</li>\r\n<li>Expandable memory capacity - 32 GB<br />suported all bangladeshi sim card</li>\r\n<li>Post Purchase of the JioFi device along with a all SIM, the customer can choose any one of the three JioFi plans (chargeable), as part of offer, to get Jio UNLIMITED VOICE+DATA for up to 5 months. At the time of SIM activation, choose one of the following options;For Offer Terms and Condition, Refer Technical Specifications section</li>\r\n</ul>'),
(199, 'NC4', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/10.%20Network%20Components/4.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'Red, Black, Blue', 'NO', '<h4><strong>Product details of Arduino UNO R3 Atmega328P Development board for Arduino Robotics and DIY Projects USB Cable Microcontroller</strong></h4>\r\n<ul>\r\n<li>ATmega328 Operating voltage 5V Input voltage (recommended) 7-12V Input voltage (limits) 6-20V Digital I/O pins 14 (of which 6 provide PWM output) Analog input pins 6 DC current per I/O Pin 40 mA DC current for 3.3V Pin 50 mA Flash memory 32 KB of which 0.5 KB used by bootloader SRAM 2 KB EEPROM 1 KB Clock speed 16 MHz Package Includes: 1pcs x UNO R3 1pcs x USB Cable</li>\r\n</ul>'),
