(207, 'SOFT2', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/2.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'NO', 'NO', '<h4><strong>Product details of Norton 360 Standard 1 Device 1 Year</strong><br /><strong>ONGOING PROTECTION Install protection for 1 PC, Mac, or mobile device - A card with product key code will be mailed to you (select &lsquo;Download&rsquo; option for instant activation code)</strong></h4>\r\n<ul>\r\n<li>REAL-TIME THREAT PROTECTION Advanced security protects against existing and emerging malware threats, including ransomware and viruses, and it won&rsquo;t slow down your device performance.</li>\r\n<li>SECURE VPN Browse anonymously and securely with a no-log VPN while using public Wi-Fi. Add bank-grade encryption to help keep your information like passwords and bank details secure and private.</li>\r\n<li>Dark web monitoring powered by lifelock we monitor and notify you if we find your personal information on the dark web.<br />10gb secure pc cloud backup store and help protect important files as a preventative measure to data loss due to hard drive failures, stolen devices and even ransomware.***</li>\r\n<li>Pre-paid subscription a payment method must be stored in your Norton account to activate You won&rsquo;t be charged until the prepaid term ends. For new Norton subscriptions only at an introductory price</li>\r\n<li>AUTO-RENEWAL Never have a service disruption since this subscription auto-renews annually. If you do not wish to renew, you can cancel in your Norton account anytime..</li>\r\n</ul>'),
(208, 'SOFT3', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/3.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/3.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'NO', 'NO', '<h4><strong>Product details of ESET 2021 Internet Security - 1 User, 1 Year</strong><br /><strong>Secure all your devices Split the protection it a PC, Mac, smartphone or tablet.</strong></h4>\r\n<ul>\r\n<li>Easy to use, automatically detects and removes viruses, Trojans, malware. Keeps your device safe, secure, protects against malicious virus attacks</li>\r\n<li>Safer online banking and shopping: Automatically secures transactions on internet banking sites and helps to protect you on online payment gateways</li>\r\n<li>Regain control of your webcam and router: Get an alert when anyone tries to access your webcam; Check your router\'s security and see who\'s connected</li>\r\n<li>The best balance for your security and privacy: Essential defense against malware, with our trademark best balance of detection, speed and usability</li>\r\n<li>Strong Antivirus at the core: Our award-winning Antivirus protection now includes Script-Based attack protection</li>\r\n</ul>'),
(209, 'SOFT4', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/4.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/2.%20Electronic%20Accessories/11.%20Software/4.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'NO', 'NO', '<h4><strong>Product details of Kaspersky Internet Security Latest Version - 1 PC, 1 Year (CD) With Free Bag </strong></h4>\r\n<ul>\r\n<li>প্রথমেই মাই ক্যাসপারস্কি পোর্টালে প্রবেশ করুন-my.kaspersky.com -যদি আপনার মাই ক্যাসপারস্কি একাউন্ট না থাকে, তাহলেmy.kaspersky.comএ প্রবেশ করে উপরে ডান দিকে সাইন আপ অপশনে ক্লিক করে খুব সহজেই একটি মাই ক্যাসপারস্কি একাউন্ট করে নিন। এটা খুবই সহজ এবং সম্পূর্ন ফ্রি।</li>\r\n<li>আপনার লাইসেন্স পিরিয়ড চলাকালীন সময় আপনার ডিভাইসগুলোতে বিভিন্ন অ্যাপ্লিকেশন ব্যবহারের ক্ষেত্রে মাই ক্যাসপারস্কি আপনাকে একসেস দিবে। তাছাড়াও মাই ক্যাসপারস্কি একাউন্ট ওয়েব এর মাধ্যমে আপনার প্রত্যেকটি ডিভাইসের নিরাপত্তা নিশ্চিত করবে এবং আপনাকে কিছু অ্যাপ্লিকেশনের ওয়েব ভার্সন এর নিরাপদ ব্যবহার নিশ্চিত করবে। তাই অবশ্যই আপনার মাই ক্যাসপারস্কি একাউন্ট এর ইউজার আইডি এবং পাসওয়ার্ড মনে রাখুন। -আর যদি আপনার মাই ক্যাসপারস্কি একাউন্ট থাকে, তাহলে দয়া করে আপনার লগ ইন আইডি ও পাসওয়ার্ডের মাধ্যমে লগ ইন করুন।</li>\r\n<li>লাইসেন্স ট্যাব এ ক্লিক করুন এবং যথাযথ স্থানে আপনার ২০ ডিজিটের অ্যাক্টিভেশন কোডটি প্রবেশ করুন। আপনার ড্যাশবোর্ডের নীচের দিকে ডান কোনায় প্রদত্ত ডাউনলোড বাটনে ক্লিক করে আপনার অ্যাপ্লিকেশনটি ডাউনলোড করুন এবং এরপর ইনস্টল করুন।</li>\r\n<li>আপনার ড্যাশবোর্ড থেকে ডাউনলোড লিংকটি আপনার ইমেইলে নিয়ে আপনার অন্যান্য ডিভাইসেও অ্যাপ্লিকেশনটি ইনস্টল করতে পারবেন। আপনি যখন মাই ক্যাসপারস্কি পোর্টাল থেকে অ্যাপ্লিকেশন ডাউনলোড করবেন, তখন সাধারনত সাইন ইন উইন্ডোতে কোন প্রকার ডাটা ইনপুট না করলেও সয়ংক্রিয়ভাবে ইনস্টলেশন প্রক্রিয়াটি সম্পন্ন হবে। তবে, কখনো কখনো আপনার মাই ক্যাসপারস্কি একাউন্ট এর ইউজার আইডি ও পাসওয়ার্ড চাইতে পারে।</li>\r\n</ul>'),
