(242, 'BT1', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/1.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/1.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'NO', 'NO', '<h4><strong>Olive Oil</strong></h4>\r\n<ul>\r\n<li>রিবানা পরিবারে নতুন আকর্ষণ - অলিভ অয়েল! <br/>আসছে শীতে আপনার ত্বক ও চুলের সর্বাধিক পুষ্টি নিশ্চিত করতে আমরা নিয়ে এলাম অলিভ অয়েল। স্পেন থেকে আমদানিকৃত অলিভের ১০০% খাঁটি ও পিউর আমাদের ভার্জিন অলিভ অয়েল। জলপাই ফ্যাটি এসিড এবং অ্যান্টি-অক্সিডেন্টসে সমৃদ্ধ। এতে আছে প্রচুর পরিমান ভিটামিন &lsquo;ই&rsquo;। আর তাই শুষ্ক ত্বকের সুরক্ষা করে, রাখে ময়েশ্চারাইজড শীতকালে ত্বকের কুঁচকানো বা রিংকেল এর মত সমস্যা দূর হয়। এন্টি-এজিং এ সাহায্য করে। শিশুর ত্বকেও অলিভ অয়েল নিরাপদ। অলিভ অয়েলে পর্যাপ্ত এসেনশিয়াল ফ্যাটি অ্যাসিড রয়েছে যা স্ক্যাল্পকে পুনরুজ্জীবিত করে, চুলের গোড়ায় পুষ্টি জোগায়, চুল পরা কমায় এবং চুলের বৃদ্ধিতে সাহায্য করে৷ ভিটামিন \'ই\' থাকায় অলিভ অয়েল ড্রাই ও রাফ চুলের আদ্রতা ধরে রাখে।</li>\r\n<li>এখন থেকে রিবানায় মাত্র ৩৫০ টাকায় পেয়ে যাচ্ছেন সবচেয়ে খাঁটি অলিভ অয়েল।</li>\r\n</ul>'),
(243, 'BT2', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/2.jpg', 'http://localhost/ecommerce%20images/1.%20category%20and%20subcategory/4.%20Health%20&%20Beauty/2.%20Beauty%20Tools/2.jpg', 'Some Of Our Exclusive Collection, You May Like Some Of Our Exclusive Collection', 'NO', 'NO', '<h4><strong>Product details of Aloe Olive Oil (এ্যালো-অলিভ অয়েল) (100ml)</strong></h4>\r\n<ul>\r\n<li>Softens and Moisturizes Skin<br />Tightens Skin<br />Removes Spots<br />Works as an Anti-Ageing Agent<br />Healthy for Haircare and Scalp care<br />এ্যালো অলিভ অয়েল যা অ্যালোভেরা ও অলিভ অয়েল এর সমন্বয়ে তৈরি বিশেষ তেল। এ্যালো অলিভ অয়েল ব্যবহার করলে যেসব উপকার পাবেন:<br />১. দাগ মুক্ত ও কোমল সজীব ত্বক। ২. বয়সের ছাপ দূর করবে। ৩. ত্বক টানটান করে। ৪. এন্টি-এজিং হিসেবে কাজ করে ত্বকের জন্য।</li>\r\n<li>আ্যলোভেরার পুর্ন গুনাগুন বিশিষ্ট এই অয়েলটি আপনি মুখে. ও শরিরের যে কোনো স্থানের ত্বকে ব্যবহার করতে পারবেন ক্রিম বা লোশনের মতোই। এন্টি এজিং সুফল পাওয়ার জন্য প্রতিদিন ঘুমাতে যাবার আগে এই অয়েল মুখে ব্যবহার করবেন। গোসলের পর এবং মুখ ধোয়ার পর ব্যবহার করবেন। মুখের স্কিন সজীব থাকবে। দাগ বা বলিরেখা থাকলে তা মিলিয়ে যাবে।</li>\r\n</ul>'),
