INSERT INTO `siteinfo` (`id`, `about`, `terms`, `ploicy`, `purchase_guide`, `about_company`, `address`, `android_app_link`, `ios_app_link`, `facebook_link`, `twitter_link`, `instagram_link`, `delivery_notice`, `refund`) VALUES
(1, '<h3 ddd bhhhhhhhhhhh data-spm-anchor-id=\"a2a0e.11884642.2013837060.i0.6b4bd82enZWVlx\">Conditions for Returns</h3> <ol class=\"olclass\"> <li data-spm-anchor-id=\"a2a0e.11884642.2013837060.i1.6b4bd82enZWVlx\">The product must be unused, unworn, unwashed and without any flaws. Fashion products can be tried on to see if they fit and will still be considered unworn. If a product is returned to us in an inadequate condition, we reserve the right to send it back to you.</li> <li data-spm-anchor-id=\"a2a0e.11884642.2013837060.i2.6b4bd82enZWVlx\">The product must include the original tags, user manual, warranty cards, freebies and accessories.</li> <li>The product must be returned in the original and undamaged manufacturer packaging / box. If the product was delivered in a second layer of Daraz packaging, it must be returned in the same condition with return shipping label attached. Do not put tape or stickers on the manufacturers box.d</li> </ol>', '<h3 data-spm-anchor-id=\"a2a0e.11884642.2013837060.i0.6b4bd82enZWVlx\">Conditions for Returns</h3> <ol class=\"olclass\"> <li data-spm-anchor-id=\"a2a0e.11884642.2013837060.i1.6b4bd82enZWVlx\">The product must be unused, unworn, unwashed and without any flaws. Fashion products can be tried on to see if they fit and will still be considered unworn. If a product is returned to us in an inadequate condition, we reserve the right to send it back to you.</li> <li data-spm-anchor-id=\"a2a0e.11884642.2013837060.i2.6b4bd82enZWVlx\">The product must include the original tags, user manual, warranty cards, freebies and accessories.</li> <li>The product must be returned in the original and undamaged manufacturer packaging / box. If the product was delivered in a second layer of Daraz packaging, it must be returned in the same condition with return shipping label attached. Do not put tape or stickers on the manufacturers box.</li> </ol>', '<br>\n<br>\n<p style=\"text-align: justify;\">Welcome to the BECOM website (the \"Site\") operated by Daraz Bangladesh Ltd. We respect your privacy and want to protect your personal information. To learn more, please read this Privacy Policy.<br /><br />This Privacy Policy explains how we collect, use and (under certain conditions) disclose your personal information. This Privacy Policy also explains the steps we have taken to secure your personal information. Finally, this Privacy Policy explains your options regarding the collection, use and disclosure of your personal information. By visiting the Site directly or through another site, you accept the practices described in this Policy.<br /><br />Data protection is a matter of trust and your privacy is important to us. We shall therefore only use your name and other information which relates to you in the manner set out in this Privacy Policy. We will only collect information where it is necessary for us to do so and we will only collect information if it is relevant to our dealings with you.<br /><br />We will only keep your information for as long as we are either required to by law or as is relevant for the purposes for which it was collected.<br /><br />You can visit the Site and browse without having to provide personal details. During your visit to the Site you remain anonymous and at no time can we identify you unless you have an account on the Site and log on with your user name and password.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h4 style=\"text-align: justify;\">1. Data that we collect</h4>\n<p style=\"text-align: justify;\">We may collect various pieces of information if you seek to place an order for a product with us on the Site.<br /><br />We collect, store and process your data for processing your purchase on the Site and any possible later claims, and to provide you with our services. We may collect personal information including, but not limited to, your title, name, gender, date of birth, email address, postal address, delivery address (if different), telephone number, mobile number, fax number, payment details, payment card details or bank account details.<br /><br />We will use the information you provide to enable us to process your orders and to provide you with the services and information offered through our website and which you request. Further, we will use the information you provide to administer your account with us; verify and carry out financial transactions in relation to payments you make; audit the downloading of data from our website; improve the layout and/or content of the pages of our website and customize them for users; identify visitors on our website; carry out research on our users\' demographics; send you information we think you may find useful or which you have requested from us, including information about our products and services, provided you have indicated that you have not objected to being contacted for these purposes. Subject to obtaining your consent we may contact you by email with details of other products and services. If you prefer not to receive any marketing communications from us, you can opt out at any time.<br /><br />We may pass your name and address on to a third party in order to make delivery of the product to you (for example to our courier or supplier). You must only submit to us the Site information which is accurate and not misleading and you must keep it up to date and inform us of changes.<br /><br />Your actual order details may be stored with us but for security reasons cannot be retrieved directly by us. However, you may access this information by logging into your account on the Site. Here you can view the details of your orders that have been completed, those which are open and those which are shortly to be dispatched and administer your address details, bank details ( for refund purposes) and any newsletter to which you may have subscribed. You undertake to treat the personal access data confidentially and not make it available to unauthorized third parties. We cannot assume any liability for misuse of passwords unless this misuse is our fault.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h4 style=\"text-align: justify;\">Other uses of your Personal Information</h4>\n<p style=\"text-align: justify;\">We may use your personal information for opinion and market research. Your details are anonymous and will only be used for statistical purposes. You can choose to opt out of this at any time. Any answers to surveys or opinion polls we may ask you to complete will not be forwarded on to third parties. Disclosing your email address is only necessary if you would like to take part in competitions. We save the answers to our surveys separately from your email address.<br /><br />We may also send you other information about us, the Site, our other websites, our products, sales promotions, our newsletters, anything relating to other companies in our group or our business partners. If you would prefer not to receive any of this additional information as detailed in this paragraph (or any part of it) please click the \'unsubscribe\' link in any email that we send to you. Within 7 working days (days which are neither (i) a Sunday, nor (ii) a public holiday anywhere in Bangladesh) of receipt of your instruction we will cease to send you information as requested. If your instruction is unclear we will contact you for clarification.<br /><br />We may further anonymize data about users of the Site generally and use it for various purposes, including ascertaining the general location of the users and usage of certain aspects of the Site or a link contained in an email to those registered to receive them, and supplying that anonymized data to third parties such as publishers. However, that anonymized data will not be capable of identifying you personally.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h4 style=\"text-align: justify;\">Competitions</h4>\n<p style=\"text-align: justify;\">For any competition we use the data to notify winners and advertise our offers. You can find more details where applicable in our participation terms for the respective competition.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h4 style=\"text-align: justify;\">Third Parties and Links</h4>\n<p style=\"text-align: justify;\">We may pass your details to other companies in our group. We may also pass your details to our agents and subcontractors to help us with any of our uses of your data set out in our Privacy Policy. For example, we may use third parties to assist us with delivering products to you, to help us to collect payments from you, to analyze data and to provide us with marketing or customer service assistance.<br /><br />We may exchange information with third parties for the purposes of fraud protection and credit risk reduction. We may transfer our databases containing your personal information if we sell our business or part of it. Other than as set out in this Privacy Policy, we shall NOT sell or disclose your personal data to third parties without obtaining your prior consent unless this is necessary for the purposes set out in this Privacy Policy or unless we are required to do so by law. The Site may contain advertising of third parties and links to other sites or frames of other sites. Please be aware that we are not responsible for the privacy practices or content of those third parties or other sites, nor for any third party to whom we transfer your data in accordance with our Privacy Policy.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h4 style=\"text-align: justify;\">2. Cookies</h4>\n<p style=\"text-align: justify;\">The acceptance of cookies is not a requirement for visiting the Site. However we would like to point out that the use of the \'basket\' functionality on the Site and ordering is only possible with the activation of cookies. Cookies are tiny text files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer\'s hard drive. Cookies can be used to recognize your Internet Protocol address, saving you time while you are on, or want to enter, the Site. We only use cookies for your convenience in using the Site (for example to remember who you are when you want to amend your shopping cart without having to re-enter your email address) and not for obtaining or using any other information about you (for example targeted advertising). Your browser can be set to not accept cookies, but this would restrict your use of the Site. Please accept our assurance that our use of cookies does not contain any personal or private details and are free from viruses. If you want to find out more information about cookies, go to http://www.allaboutcookies.org or to find out about removing them from your browser, go to http://www.allaboutcookies.org/manage-cookies/index.html.<br /><br />This website uses Google Analytics, a web analytics service provided by Google, Inc. (\"Google\"). Google Analytics uses cookies, which are text files placed on your computer, to help the website analyze how users use the site. The information generated by the cookie about your use of the website (including your IP address) will be transmitted to and stored by Google on servers in the United States. Google will use this information for the purpose of evaluating your use of the website, compiling reports on website activity for website operators and providing other services relating to website activity and internet usage. Google may also transfer this information to third parties where required to do so by law, or where such third parties process the information on Google\'s behalf. Google will not associate your IP address with any other data held by Google. You may refuse the use of cookies by selecting the appropriate settings on your browser, however please note that if you do this you may not be able to use the full functionality of this website. By using this website, you consent to the processing of data about you by Google in the manner and for the purposes set out above.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h4 style=\"text-align: justify;\">3. Security</h4>\n<p style=\"text-align: justify;\">We have in place appropriate technical and security measures to prevent unauthorized or unlawful access to or accidental loss of or destruction or damage to your information. When we collect data through the Site, we collect your personal details on a secure server. We use firewalls on our servers. Our security procedures mean that we may occasionally request proof of identity before we disclose personal information to you. You are responsible for protecting against unauthorized access to your password and to your computer.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h4 style=\"text-align: justify;\">4. Your rights</h4>\n<p style=\"text-align: justify;\" data-spm-anchor-id=\"a2a0e.11872978.5088460210.i0.7523582dyk9wsa\">If you are concerned about your data you have the right to request access to the personal data which we may hold or process about you. You have the right to require us to correct any inaccuracies in your data free of charge. At any stage you also have the right to ask us to stop using your personal data for direct marketing purposes.</p>', '<h3 data-spm-anchor-id=\"a2a0e.11884642.2013837060.i0.6b4bd82enZWVlx\">Conditions for Returns</h3> <ol class=\"olclass\"> <li data-spm-anchor-id=\"a2a0e.11884642.2013837060.i1.6b4bd82enZWVlx\">The product must be unused, unworn, unwashed and without any flaws. Fashion products can be tried on to see if they fit and will still be considered unworn. If a product is returned to us in an inadequate condition, we reserve the right to send it back to you.</li> <li data-spm-anchor-id=\"a2a0e.11884642.2013837060.i2.6b4bd82enZWVlx\">The product must include the original tags, user manual, warranty cards, freebies and accessories.</li> <li>The product must be returned in the original and undamaged manufacturer packaging / box. If the product was delivered in a second layer of Daraz packaging, it must be returned in the same condition with return shipping label attached. Do not put tape or stickers on the manufacturers box.</li> </ol>', '<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation</p>', 'Laradigir Poschim Par 123, Sylhet.Mob: 01914671167, 01632968811Email: dhiraj.baidya.kintu@gmail.com <p>Dhiraj Baidya Kintu</p>', 'https://dhirajkintu.blogspot.com/1234', 'https://dhirajkintu.blogspot.com/', 'https://www.facebook.com/1234', 'https://twitter.com/login?lang=en', 'https://www.instagram.com/', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in', '<h3 data-spm-anchor-id=\"a2a0e.11884642.2013837060.i2.7c24d82eOK1dUY\">Conditions for Returns</h3>\r\n<ol class=\"olclass\">\r\n<li data-spm-anchor-id=\"a2a0e.11884642.2013837060.i1.7c24d82eOK1dUY\">The product must be unused, unworn, unwashed and without any flaws. Fashion products can be tried on to see if they fit and will still be considered unworn. If a product is returned to us in an inadequate condition, we reserve the right to send it back to you.</li>\r\n<li>The product must include the original tags, user manual, warranty cards, freebies and accessories.</li>\r\n<li>The product must be returned in the original and undamaged manufacturer packaging / box. If the product was delivered in a second layer of Daraz packaging, it must be returned in the same condition with return shipping label attached. Do not put tape or stickers on the manufacturers box.</li>\r\n</ol>\r\n<h3><strong>Conditions for Returns</strong></h3>\r\n<ul class=\"custom-counter return-product-step margin-btm-30\">\r\n<li>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12 col-xs-12\">\r\n<p data-spm-anchor-id=\"a2a0e.11884642.2013837060.i0.7c24d82eOK1dUY\">Sign in to your Daraz Account, select My Orders.</p>\r\n</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12 col-xs-12\">\r\n<p class=\"liwidth\">Select the order you wish to return and click on the Manage Order button.</p>\r\n</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12 col-xs-12\">\r\n<p class=\"liwidth\">Click on Return Items.</p>\r\n</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12 col-xs-12\">\r\n<p class=\"liwidth\">Fill in the Return Form. The available return options (drop-off/pickup) will be displayed in this form.</p>\r\n</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12 col-xs-12\">\r\n<p class=\"liwidth\">Pack your Daraz parcel securely, with the product in&nbsp;<strong>the original and undamaged manufacturer\'s packaging&nbsp;</strong>as delivered to you and secure the Return Label on top of the return package.</p>\r\n</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12 col-xs-12\">\r\n<p class=\"liwidth\">If you are located in Dhaka city, then you will be able to avail pick up and drop off both facilities from specific areas. If you are located outside Dhaka, we have customer return drop off points in different locations where you can drop your return product.</p>\r\n&nbsp;\r\n<p>Check both Inside and Outside Locations-&nbsp;<a href=\"https://pages.daraz.com.bd/wow/i/bd/help-pages/daraz-return-drop-off-points?hybrid=1\">Click Here</a></p>\r\n&nbsp;\r\n<p>To avail pick up facilities from Collection points from both Inside and Outside Locations-&nbsp;<a href=\"https://pages.daraz.com.bd/wow/i/bd/help-pages/daraz-shop?hybrid=1\">Click Here</a></p>\r\n</div>\r\n</div>\r\n</li>\r\n</ul>');
